Movie Info: Satya 2 is a 2013 Indian bilingual crime film, simultaneously shot in Hindi and Telugu. The film was directed by Ram Gopal Varma with production design by Saini S. Johray. The film stars Puneet Singh Ratn (Hindi), Sharwanand (Telugu), Anaika Soti, Aradhna Gupta and Mahesh Thakur in lead roles. The film tells the story of Satya, an immigrant who comes to Mumbai aiming to refashion the mumbai underworld.


